import React from 'react';
import './AllPlayers.css'



function AllPlayers() {
  return (
    <div className="allPlayers">
      <h4>Players</h4>
      <div className="allPlayersArea">
        <p>player 1</p>
        <p>player 2</p>
        <p>player 3</p>
        <p>player 4</p>
        <p>player 5</p>
        <p>player 6</p>
        <p>player 7</p>
      </div>
    </div>
  );
}

export default AllPlayers;
